import React from "react";
import CalendarTodayIcon from '@mui/icons-material/CalendarToday';
const Header=()=>{
    return (
    <>
    <div className="header">
    <h1>
    <CalendarTodayIcon />
    <span>Hasnain Shahzad</span> 
    </h1>
    </div>
    </>
    )
}
export default Header;
